import React from 'react';
import zardosi1 from '../Assets/zardosi1.png';
import zardosi2 from '../Assets/zardosi2.png';
import zardosi3 from '../Assets/zardosi3.jpg';
import ari1 from'../Assets/ari1.jpg';

function Gallery() {
    return (
        <div>
            <h1 style={{ fontFamily: 'sans-serif', color: '#017bf5', textAlign: 'center' }}>BEAUTIFUL IMAGE GALLERY</h1>
            <h2 style={{ fontFamily: 'sans-serif', color: '#444', textAlign: 'center' }}>USING REACT.JS</h2>
            <div style={{ display: 'flex', justifyContent: 'center' }}>
                <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                    <img src={ari1} height="350" width="400" alt="Image 1" />
                    <img src={zardosi1} height="350" width="400" alt="Image 2" />
                    <img src={zardosi2} height="350" width="400" alt="Image 3" />
                    <img src={zardosi3} height="350" width="400" alt="Image 4" />
                </div>
                <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                    <img src={ari1} height="350" width="400" alt="Image 5" />
                    <img src={zardosi1} height="350" width="400" alt="Image 6" />
                    <img src={zardosi2} height="350" width="400" alt="Image 7" />
                    <img src={zardosi3} height="350" width="400" alt="Image 8" />
                </div>
                <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                    <img src={arguments} height="350" width="400" alt="Image 9" />
                    <img src={zardosi1} height="350" width="400" alt="Image 10" />
                    <img src={zardosi2} height="350" width="400" alt="Image 11" />
                    <img src={zardosi3} height="350" width="400" alt="Image 12" />
                </div>
            </div>
        </div>
    );
}

export default Gallery;
